import React from 'react';
import Container from 'react-bootstrap/esm/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Developer = () => {

    return (
        <div className='main-content'>
            <Container className="mt-5">
                <Row className="justify-content-center">
                    <img src="ProfilePhoto.JPG" alt="Yifei Zhou" style={{ width: '20%', height: '20%' }} />
                    <h1>Developer</h1>
                    <h2>Yifei Zhou</h2>
                    <p>MS Computer Science Student at Brandeis University</p>
                </Row>
            </Container>
            <Card style={{ width: '54rem', height: '75rem', margin: '10px', backgroundColor: 'black', border: '1px solid white' }}>
                <div className="d-flex justify-content-center align-items-center">
                  <Card.Img variant="top" src="ProfilePhoto.JPG" alt="Yifei Zhou" style={{ width: '17rem', height: '18rem', marginBottom: '10px' }} />
                </div>
                <Card.Body>
                  <Card.Title style={{ fontSize: '1.2rem', marginBottom: '10px', color: 'white' }}>{recipe.title}</Card.Title>
                  <Link to={`/recipes/${recipe.id}`}>
                    <Button 
                      style={{ padding: '6px 10px', fontSize: '1.0rem', marginBottom: '10px', backgroundColor: 'white', color: 'black' }}
                      variant="primary" index={recipe.id}>
                      Details
                    </Button>
                  </Link>
                </Card.Body>
              </Card>
        </div>
    );
}

export default Developer;
